          "id": "a878f7635bc2d1a14a7a439002524582f895585c",
          "message": "CN: Fix #598 (solver crash) reduce mutability\n\nPR #251 added support for a new solver backend, but also introduced a\nbug which, with `--vip` enabled, caused the solver to crash.\n\nThe root cause was that calls to `provable` were interfering with\n`model_evaluator` because of unnecessary shared mutability.\n\nThis can be fixed by calling `Int_Table.copy` in `copy_solver_frame`,\nbut instead this removes the two-layer hashtable and replaces it with a\nsimpler pair-lookup map.",
